    false,nt"url": null,nt"notes": "An ornithological study of the breeding
    birds of the islands that make up the Gardner Division and the Bear Creek Unit of
    Mark Twain NWR was initiated in 1992. A follow up study was cancelled in 1993 because
    the entire Gardner Division was under approximately 8 feet of water for nearly two
    months. In 1994, a new expanded study was initiated to again survey the breeding
    birds on the refuge. This information along with vegetation analysis will be useful
    in comparing pre and post flood conditions and the effect it had on the flora and
    fauna of the refuge.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
